import React from 'react';

function Page({ unit, index }) {
    const pages = [
        [
            <p>unit 1 first page :)</p>,
            <p>unit 1 second page :)</p>
        ]
        [
            <p>unit 2 first page :)</p>,
            <p>unit 2 second page :)</p>
        ]
    ];
    if(unit - 1 < pages.length){
        if (index - 1 < pages[unit - 1].length){
            return pages[unit - 1][index - 1];
        }
    }
    return <p>page failed :(</p>;
}
export default Page;
